import React,{Component} from 'react';

class SingleComplain extends Component {
    render() {
        return (
            
                <tr>
                            <th scope="row"></th>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td>
                                <form  >
                                    <input type="hidden" name="sno" value="" />
                                    <input type="hidden" name="cat" value="" />
                                    <button type="submit" name="approve" class="btn btn-outline-success">Approve</button>
                                    <button type="submit" name="reject" class="btn btn-outline-danger">Reject</button>
                                </form>
                            </td>
                            </tr>
            
        );
    }
}

export default SingleComplain;
